import { gql } from '@apollo/client'

export const GET_REPOSITORIES = gql`
	query Query {
        repositories {
          edges {
            node {
                id
                ownerAvatarUrl
                description
                language
                stargazersCount
                reviewCount
                ratingAverage
                fullName
                forksCount
            }
          }
        }
	}
`

export const GET_ME = gql`
  query Query {
    me {
      username
    }
  }
`
